import ExpenseItem from './components/ExpenseItem'

function App() {
  const expenses = [
    { title: 'Car insurance', price: 267.13},
    { title: 'MOT', price: 132.16},
    { title: 'Exhaust', price: 50.31}
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} price={expenses[0].price}></ExpenseItem>
      <ExpenseItem title={expenses[1].title} price={expenses[0].price}></ExpenseItem>
      <ExpenseItem title={expenses[2].title} price={expenses[0].price}></ExpenseItem>
    </div>
  );
}


export default App;
